        <script>
            // hint: 1 if only email field, 2 if email and password fields
            function getCurrentStage() {
                return $('#password').is(':hidden') ? 1 : 2
            }
            function genericAjaxErrorCallback(jqXHR) {
                // console.log(jqXHR)
            }
            $(document).ready(function () {
                $('#emailIdentificationForm').on('submit', function (event) {
                    event.preventDefault()
                    if ($('#password').is(':hidden')) {
                        $.post('/identity/lalo/validate', {emailLookup:  $('[name="email"]').val()}) // dont serialize pwd at 1st stsage
                        .done(function (data) {
                            const jData = JSON.parse(data)
                            console.log(jData)
                            if (jData.statusCode === 0) {
                                window.location.href = jData.emailProvider
                            } else {
                                // console.debug("Didn't get '1' as response, got: '" + response + "' instead.")
                                // enable pwd field....
                                $('#password').removeAttr('hidden')
                                $('#password').attr('required', true);

                            }
                            })
                            .fail(genericAjaxErrorCallback)
                    } else if ($('#password').is(':visible')) {
                        $.post('/identity/login/verify', $('form').serialize())
                        .done(function(data) {
                            window.location.href = '/auth/login/finish'
                        })
                        .fail(genericAjaxErrorCallback)
                    }
                })
            })
        </script>
    

